\centering
\ergebnis
}
};

\draw % connect said box to the end of task
(\ende*\inkrement:\myradius) -- (ende);

\pgfmathparse{\anfang+\dauer} % set \anfang to the end of current task for next task
\xdef\anfang{\pgfmathresult}
}
\end{tikzpicture}
